import React, { useState } from 'react';
import Container from 'react-bootstrap/Container';
import styles from './App.module.css';
import NavBar from './components/NavBar';
import { Routes, Route } from "react-router-dom";
import './api/axiosDefault'
import SignUpForm from './pages/auth/SignUpForm';
import SignInForm from './pages/auth/SignInForm';
import ProfileDetail from "./pages/ProfileDetail";

function App() {

  return (
    <div className={styles.App}>
      <NavBar />
      <Container className={styles.Main}>
        <Routes>
          <Route exact="true" path="/" render={() => <h1>Home page</h1>} />
          <Route exact="true" path="/signin" element={<SignInForm />} render={() => <SignInForm />} />
          <Route exact="true" path="/signup" element={<SignUpForm />}render={() => <SignUpForm />} />
          <Route path="/profile/:username" element={<ProfileDetail />} render={(props) => <ProfileDetail />} />
          <Route render={() => <p>Page not found!</p>} />
        </Routes>
      </Container>
    </div>
  );
}

export default App;
